import React, { Component } from 'react';
import './login.css'

class Login extends Component {
    render() {
        return (
            <>
                <div className='inpDiv'>
                    <label htmlFor='userName' >Username/email :&nbsp;&nbsp;</label><br></br>
                    <input id='userName' className='userInp' placeholder='Enter your name here:' />
                </div>
                <div className='inpDiv'>
                    <label htmlFor='userPassword'>Password :&nbsp;&nbsp;</label><br></br>
                    <input id='userPassword' className='userInp' placeholder='Enter your password here:' />
                </div>
            </>
        )
    };
};

export default Login;
